import React from "react";
import { Container, Navbar ,Nav} from "react-bootstrap";
const Header = () => {
  return (
    <Navbar
      bg="dark"
      expand="sm"
      variant="dark"
      className="position-fixed w-100 "
      style={{ zIndex: "5" }}
    >
      <Container className="">
        {/* <Navbar.Brand href="http://localhost:3000/">HOME</Navbar.Brand>
        <Navbar.Brand href="http://localhost:3000/STORE">STORE</Navbar.Brand>
        <Navbar.Brand href="http://localhost:3000/ABOUT">ABOUT</Navbar.Brand>
        <Navbar.Brand href="http://localhost:3000/CONTACT">CONTACT US</Navbar.Brand> */}
        <Nav variant="pills" defaultActiveKey="http://localhost:3000">
          <Nav.Item>
            <Nav.Link eventKey="http://localhost:3000/">HOME</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link href="http://localhost:3000/STORE">STORE</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link href="http://localhost:3000/ABOUT" >
            ABOUT
            </Nav.Link>
          </Nav.Item>
        </Nav>
      </Container>
    </Navbar>
  );
};

export default Header;
